import { useState } from "react";
import TreeList from "./TreeList";

const TreeItem = ({ item }) => {

  const [expand, setExpand] = useState(false);

  const onExpandHandler = () => {
    console.log("clicked!");
    setExpand(!expand);
  };

  return (
    <div>
      <div>{item.label}</div>
      <div onClick={onExpandHandler}>{item.children && expand ? "-" : "+"}</div>
      <div>{expand && item.children && <TreeList list={item.children} />}</div>
    </div>
  );

};

export default TreeItem;
